DROP TABLE IF EXISTS `function`;
CREATE TABLE `function` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(255) DEFAULT NULL COMMENT '功能名称',
  `code` varchar(100) DEFAULT NULL COMMENT '功能编码',
  `type` varchar(100) DEFAULT NULL COMMENT '类别',
  `path` varchar(255) DEFAULT NULL COMMENT '链接路径',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `parent_id` int(11) DEFAULT NULL COMMENT '父功能id',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图标路径',
  `in_mobile_app` tinyint(1) NOT NULL DEFAULT '0' COMMENT '移动APP模块',
  `mobile_name` varchar(255) DEFAULT NULL COMMENT '在APP中的名称',
  `mobile_type` varchar(100) DEFAULT NULL,
  `read_write_type` tinyint(2) DEFAULT '3' COMMENT '1表示该功能点只支持读权限配置，2表示只支持写，3表示都支持',
  `authorization` varchar(500) NOT NULL DEFAULT '|1|' COMMENT '该功能的具有权限的id集合以''|''间隔',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=189 DEFAULT CHARSET=utf8 COMMENT='功能表';

